import { BrowserRouter } from 'react-router-dom';
import { Link } from 'react-router-dom'

class Navigation extends Component {
  render() {
    return (
      <header>
        <nav>
          <ul>
            <li><Link to='/'>Home</Link></li>
            <li><Link to='/Page'>Page</Link></li>
          </ul>
        </nav>
      </header>
    );
  }
}
